A customer interacts with the SDK builders to construct an input. The build() method on an input returns an Operation<Output>. This codifies the base HTTP request & all the configuration and middleware layers required to modify and dispatch the request. pub struct Operation<H, R> { request: Request, response_handler: H, _retry_policy: R,
} pub struct Request { base: http::Request<SdkBody>, configuration: PropertyBag,
} For most requests, .build() will NOT consume the input. A user can call .build() multiple times to produce multiple operations from the same input. By using a property bag, we can define the Operation in Smithy core. AWS specific configuration can be added later in the stack.

