The Rust SDK is "modular" meaning that each AWS service is its own crate. Each crate provides two layers to access the service: The "fluent" API. For most use cases, a high level API that ties together connection management and serialization will be the quickest path to success. #[tokio::main]
async fn main() { let client = dynamodb::Client::from_env(); let tables = client .list_tables() .limit(10) .send() .await.expect("failed to load tables");
} The "low-level" API: It is also possible for customers to assemble the pieces themselves. This offers more control over operation construction & dispatch semantics: #[tokio::main]
async fn main() { let conf = dynamodb::Config::builder().build(); let conn = aws_hyper::Client::https(); let operation = dynamodb::ListTables::builder() .limit(10) .build(&conf) .expect("invalid operation"); let tables = conn.call(operation).await.expect("failed to list tables");
} The Fluent API is implemented as a thin wrapper around the core API to improve ergonomics.

