Smithy introduces a few concepts that are defined here: Shape: The core Smithy primitive. A smithy model is composed of nested shapes defining an API. Symbol: A Representation of a type including namespaces & and any dependencies required to use a type. A shape can be converted into a symbol by a SymbolVisitor. A SymbolVisitor maps shapes to types in your programming language (eg. Rust). In the Rust SDK, see SymbolVisitor.kt . Symbol visitors are composable—many specific behaviors are mixed in via small & focused symbol providers, eg. support for the streaming trait is mixed in separately. Writer: Writers are code generation primitives that collect code prior to being written to a file. Writers enable language specific helpers to be added to simplify codegen for a given language. For example, smithy-rs adds rustBlock to RustWriter to create a "Rust block" of code. writer.rustBlock("struct Model") { model.fields.forEach { write("${field.name}: #T", field.symbol) }
} This would produce something like: struct Model { field1: u32, field2: String
} Generators: A Generator, eg. StructureGenerator, UnionGenerator generates more complex Rust code from a Smithy model. Protocol generators pull these individual tools together to generate code for an entire service / protocol.

